import React from 'react';

function Home() {
  return (
    <div className="Content">
      <h1 style={{
        marginBottom: '0',
        fontWeight: 'lighter',
        fontSize: '2rem',
        paddingLeft: '2.5rem'
      }}>Blake Madigan</h1>
      <p style={{
        marginTop:'0',
        marginBottom: '1rem',
        fontSize: '1.5rem',
        fontWeight: 'bold'
      }}>Full-Stack Developer</p>
      <p class="material-icons" style={{
        marginTop:'0',
        fontSize: '1.5rem',
        fontWeight: 'bold'
      }}>facebook</p>
    </div>
  );
}

export default Home;
